import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <h1>Witaj na stronie głównej!</h1>
      
      {/* Guzik przekierowujący do logowania */}
      <Link to="/users/login">
        <button>Przejdź do logowania</button>
      </Link>
      
      {/* Guzik przekierowujący do rejestracji */}
      <Link to="/users/register">
        <button>Przejdź do rejestracji</button>
      </Link>
    </div>
  );
};

export default Home;
